import { Component } from '@angular/core';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {

}
<div class="style">
  <h2 class="style1">Registeration Page</h2>
  <form id="registration-form" method="POST" enctype="application/json">
    <div class="form-row">
      <div class="form-group col-md-6">
        <label for="Enter Phone Number">Customer Name</label>
        <input type="text" class="form-control" id="Enter Phone Number" />
      </div>
    </div>
    <div class="form-row">
      <div class="form-group col-md-6">
        <label for="inputEmail4">Email</label>
        <input
          type="email"
          class="form-control"
          id="inputEmail4"
          placeholder="Email"
        />
      </div>
      <div class="form-group col-md-6">
        <label for="inputPassword4">Password</label>
        <input
          type="password"
          class="form-control"
          id="inputPassword4"
          placeholder="Password"
        />
      </div>
    </div>
    <div class="form-group">
      <label for="inputAddress">Address</label>
      <input
        type="text"
        class="form-control"
        id="inputAddress"
        placeholder="1234 Main St"
      />
    </div>
    <div class="form-row">
      <div class="form-group col-md-6">
        <label for="Enter Phone Number">Phone Number</label>
        <input type="text" class="form-control" id="Enter Phone Number" />
      </div>
    </div>
    <div class="form-group"></div>
    <button type="submit" class="btn btn-primary">Register</button>
  </form>

  <script>
    const registrationForm = document.getElementById("registration-form");
    registrationForm.addEventListener("submit", (event) => {
      event.preventDefault();
      const formData = {
        name: document.getElementById("customer-name").value,
        email: document.getElementById("email").value,
        password: document.getElementById("password").value,
        address: document.getElementById("address").value,
        phoneNumber: document.getElementById("phone-number").value,
      };
      alert("Hello asdasd");
      fetch("http://localhost:8081", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      })
        .then((response) => {
          if (!response.ok) {
            throw new Error("Network response was not ok");
          }
          return response.json();
        })
        .then((data) => {
          console.log(data);
        })
        .catch((error) => {
          console.error("There was a problem with the fetch operation:", error);
        });
    });
  </script>
</div>
